    false,nt"url": null,nt"notes": "This project will continue a successful
    program of early detection and rapid response, monitoring and mapping of invasive
    species on Nisqually NWRC by Weed Warrior volunteers. Efforts will continue to focus
    on detecting, treating new infestations of highest priority invasive plants. Numerous
    species pose substantial threats and require an early detection rapid response program
    to preclude new infestations from becoming established. Additionally monitoring
    and treatment of more established and widespread weeds is beneficial to control
    the spread of those weeds. This program of volunteer effort will work in cooperatively
    with AmeriCorps-Washington Conservation Corps members.",nt"license_title":
